import React from 'react'
import logo from '../logo.svg';
import styles from '../CssClasses/FormStyles.module.css';

export default function ProductCatalog() {

    // const [products, setProduct] = useState([
    const tilesSample = [
        { id: 1, name: 'Amo Brown', price: 60 , size: '600x600 mm ft'},
        { id: 2, name: 'Cibola Wood', price: 25 , size: '1200x600 mm ft'},
        { id: 3, name: 'Ecowood Multi', price: 45 , size: '450x300 mm ft'},
        { id: 4, name: 'Garden Green', price: 50 , size: '300x300 mm ft'},
        { id: 5, name: 'Mosaic Art', price: 70 , size: '300x600 mm ft'},
    ];

    const listOfTiles = tilesSample.map(tiles=> 
        <tr key={tiles.id}> 
            <td style={{border: '1px solid black', width: '25'}}><img src={logo} /></td>
            <td style={{border: '1px solid black'}}>{tiles.name}</td>
            <td style={{border: '1px solid black' , width: 25}}>{tiles.price}</td>
            <td style={{border: 'solid black'}}>{tiles.size}</td>
            <td style={{border: 'solid black'}}><button>Add to Cart</button></td>
        </tr>
    );

  return (
    <div>
        <h3>List of Tiles</h3>
        <table className={styles.tileList}>
        <th>
            <td>Image</td>
            <td>Name</td>
            <td>Price</td>
            <td></td>
        </th>
            {listOfTiles}
        </table>
    </div>
  )
}
